import React from "react";
import { createChatBotMessage } from "react-chatbot-kit";
import MessageParser from "./MessageParser";
import ActionProvider from "./ActionProvider";


const botName = "Цифровой доктор";

const config = {
    botName: "Цифровой доктор",
    describe: "Диалог",
    customComponents: {
        // Replaces the default header
       header: () => <div style={{ backgroundColor: 'red', padding: "5px", borderRadius: "3px" }}>This is the header</div>
     },
    initialMessages: [
        createChatBotMessage(
        `Здравствуйте, я ваш ${botName}. Я попытаюсь помочь вам с первичной диагностикой: порекомендую вам доктора или лекарственный препарат`
        ),
        createChatBotMessage(
        "Расскажите, что вас беспокоит. Может что-то болит?",
        {
            withAvatar: false,
            delay: 500,
            widget: "overview",
        }
        ),
    ]
};

export default config;
